import React, { Component } from 'react'

export default class AboutUs extends Component {
  render() {
    return (
      <div>
        <div className="jumbotron jumbotron-fluid">
          <div className="container">
            <h1 className="display-4">“What is now proved was once only imagined.” </h1>
            <p className="lead">With us Learning and innovation go hand in hand. The arrogance of success is to think that what you did yesterday will be sufficient for tomorrow.</p>
          </div>
        </div>``
      </div>
    )
  }
}
